import 'bootstrap/dist/css/bootstrap.min.css';
import Brand from './components/Brand'

function App() {

  return (
    <ul class="navbar-nav bg-gradient-primary sidebar sidebar-dark accordion" id="accordionSidebar">
      <Brand></Brand>
      <hr class="sidebar-divider my-0"></hr>

    </ul>
  );
}

export default App;
